import{_ as t,o as i,c as a,ag as o}from"./chunks/framework.BT_aBzO2.js";const h=JSON.parse('{"title":"REST API Filtering 过滤","description":"NetBox REST API 过滤中英对照","frontmatter":{"title":"REST API Filtering 过滤","description":"NetBox REST API 过滤中英对照"},"headers":[],"relativePath":"tech-share/netbox/4.5.1/community/reference/filtering.md","filePath":"tech-share/netbox/4.5.1/community/reference/filtering.md"}'),r={name:"tech-share/netbox/4.5.1/community/reference/filtering.md"};function s(n,e,c,l,d,p){return i(),a("div",null,[...e[0]||(e[0]=[o(`<h1 id="rest-api-filtering-rest-api-过滤" tabindex="-1">REST API Filtering / REST API 过滤 <a class="header-anchor" href="#rest-api-filtering-rest-api-过滤" aria-label="Permalink to &quot;REST API Filtering / REST API 过滤&quot;">​</a></h1><p><em>内容来源 / Source: <a href="https://netboxlabs.com/docs/netbox/reference/filtering/" target="_blank" rel="noreferrer">NetBox Labs Documentation</a> | 如有侵权请<a href="/contact.html">联系我们</a>删除</em></p><h2 id="过滤对象-filtering-objects" tabindex="-1">过滤对象 | Filtering Objects <a class="header-anchor" href="#过滤对象-filtering-objects" aria-label="Permalink to &quot;过滤对象 | Filtering Objects&quot;">​</a></h2><p><strong>中文：</strong> 在 list 端点 URL 后附加一个或多个查询参数即可过滤返回对象。例如 <code>GET /api/dcim/sites/?status=active</code> 仅返回 status 为 active 的站点。多个参数组合可进一步缩小结果。同一参数传多个值一般表示 OR；如 tags 等可能多值的字段，多个值表示 AND。</p><p><strong>English:</strong> Attach one or more query parameters to the request URL to filter objects. E.g. <code>GET /api/dcim/sites/?status=active</code> returns only active sites. Multiple parameters narrow results. Multiple values for one param usually mean OR; for multi-value fields like tags, multiple values mean AND.</p><h3 id="按选项字段过滤-filtering-by-choice-field" tabindex="-1">按选项字段过滤 | Filtering by Choice Field <a class="header-anchor" href="#按选项字段过滤-filtering-by-choice-field" aria-label="Permalink to &quot;按选项字段过滤 | Filtering by Choice Field&quot;">​</a></h3><p><strong>中文：</strong> 某些模型的字段（如 Prefix 的 status）仅接受特定选项。可通过向该模型 list 端点发送带 Token 的 OPTIONS 请求，用 jq 提取 <code>actions.POST.status.choices</code> 获取所有可用选项。</p><p><strong>English:</strong> Some models have choice fields (e.g. Prefix status). Make an authenticated OPTIONS request to the list endpoint and use jq to extract <code>actions.POST.status.choices</code> for available options.</p><h3 id="按自定义字段过滤-filtering-by-custom-field" tabindex="-1">按自定义字段过滤 | Filtering by Custom Field <a class="header-anchor" href="#按自定义字段过滤-filtering-by-custom-field" aria-label="Permalink to &quot;按自定义字段过滤 | Filtering by Custom Field&quot;">​</a></h3><p><strong>中文：</strong> 自定义字段过滤时在字段名前加 <code>cf_</code>。例如 <code>GET /api/dcim/sites/?cf_foo=123</code> 只返回自定义字段 foo 等于 123 的站点。</p><p><strong>English:</strong> Prepend <code>cf_</code> to the custom field name. E.g. <code>GET /api/dcim/sites/?cf_foo=123</code> returns sites where custom field foo equals 123.</p><h2 id="查找表达式-lookup-expressions" tabindex="-1">查找表达式 | Lookup Expressions <a class="header-anchor" href="#查找表达式-lookup-expressions" aria-label="Permalink to &quot;查找表达式 | Lookup Expressions&quot;">​</a></h2><p><strong>中文：</strong> 支持在字段名后加双下划线和查找符，如 <code>mac_address__n</code> 表示不等于。数值字段支持：n, lt, lte, gt, gte, empty。字符串字段支持：n, ic(包含), nic(不包含), isw(开头), nie(不包含精确匹配), empty, regex, iregex 等。外键主要支持 n。</p><p><strong>English:</strong> Add <code>__lookup</code> suffix to field name (e.g. <code>mac_address__n</code> for negation). Numeric: n, lt, lte, gt, gte, empty. String: n, ic, nic, isw, iew, ie, nie, empty, regex, iregex. Foreign keys support n.</p><h3 id="示例-examples" tabindex="-1">示例 | Examples <a class="header-anchor" href="#示例-examples" aria-label="Permalink to &quot;示例 | Examples&quot;">​</a></h3><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>GET /api/ipam/vlans/?vid__gt=900</span></span>
<span class="line"><span>GET /api/dcim/devices/?name__ic=switch</span></span>
<span class="line"><span>GET /api/ipam/vlans/?group_id__n=3203</span></span></code></pre></div><h2 id="排序-ordering-objects" tabindex="-1">排序 | Ordering Objects <a class="header-anchor" href="#排序-ordering-objects" aria-label="Permalink to &quot;排序 | Ordering Objects&quot;">​</a></h2><p><strong>中文：</strong> 使用 <code>ordering</code> 参数。例如 <code>?ordering=facility</code> 按 facility 升序；<code>?ordering=-facility</code> 降序；<code>?ordering=facility,-name</code> 多字段排序。</p><p><strong>English:</strong> Use <code>ordering</code> param. E.g. <code>?ordering=facility</code> asc, <code>?ordering=-facility</code> desc, <code>?ordering=facility,-name</code> for multiple fields.</p><h2 id="官方文档" tabindex="-1">官方文档 <a class="header-anchor" href="#官方文档" aria-label="Permalink to &quot;官方文档&quot;">​</a></h2><ul><li><a href="https://netboxlabs.com/docs/netbox/reference/filtering/" target="_blank" rel="noreferrer">Filtering 完整文档 →</a></li></ul>`,21)])])}const f=t(r,[["render",s]]);export{h as __pageData,f as default};
